INSERT INTO `forum` VALUES (11, 'Big Update lần thứ 01', 'Big Update lần thứ 01 Thông báo BIG UPDATE thứ 01 I. Thời gian: - Sau 21h ngày 28/07 bảo trì 60 phút II. Nội dung cập nhật: 1. Nhiệm vụ chính tuyến - Cập nhật full 25 nhiệm vụ chính tuyến theo cốt truyên - Mỗi nhiệm vụ sẽ có phần thưởng vàng, hồng ngọc khi hoàn thành - Sau khi hoàn thành hết 25 nhiệm vụ, sẽ nhận được Cải trang vĩnh viễn đặc biệt 2. Cập nhật Boss - Cập nhật tất cả loại boss có mặt trong nhiệm vụ danh sách gồm: + Kuku, Mập đầu đinh, Rambo xuất hiện tại Fide + Android 13, 14, 15 xuất hiện tại Sân sau Siêu thị + Android 19, 20 xuất hiện tại Tương lai + Póc, Píc, King kong xuất hiện tại Tương lai + Tiệu đội trưởng, Số 04, Số 03, Số 02, Số 01 xuất hiện tại Fide + Xên Bọ Hung cấp 1, Xên Bọ Hung cấp 2, Xên Bọ Hung hoàn thiện xuất hiện tại Thành phố Ginder 3. Hỗ trợ nhiệm vụ - Hỗ trợ tìm và tiêu diệt Boss sẽ được cập nhật vào đợt BIG UPDATE thứ 02 Đừng quên chúng ta còn đợt BIG UPDATE 02 với nhiều tính năng như Bản đồ kho báu...', 1659342915, 2, 1, 0, 0, 1);
